-- Table: alerts
-- Purpose: Comprehensive alert and notification management system
-- Description: Stores all system alerts including threshold violations, device responses,
--              and maintenance notifications with full lifecycle tracking
-- --------------------------------------------------------

CREATE TABLE `alerts` (
  `id` int(11) NOT NULL,                                    -- Primary key, auto-increment
  `device_id` int(11) DEFAULT NULL COMMENT 'Reference to admin.devices table',  -- Device that triggered alert
  `alert_type` enum('temperature','humidity','ammonia','device_response','system','maintenance') NOT NULL,  -- Type of alert
  `alert_category` enum('threshold_violation','device_activation','system_event','maintenance_required') NOT NULL,  -- Category of alert
  `severity` enum('low','warning','critical','emergency') NOT NULL DEFAULT 'warning',  -- Alert severity level
  `parameter_name` varchar(50) NOT NULL COMMENT 'e.g., Temperature, Humidity, Ammonia',  -- Parameter that triggered alert
  `current_value` decimal(10,3) DEFAULT NULL COMMENT 'Current sensor reading',  -- Current sensor value
  `threshold_value` decimal(10,3) DEFAULT NULL COMMENT 'Threshold that triggered alert',  -- Threshold value
  `threshold_type` enum('min','max','range') DEFAULT NULL COMMENT 'Type of threshold violation',  -- Type of threshold
  `alert_message` text NOT NULL COMMENT 'Human-readable alert description',  -- User-friendly alert message
  `alert_description` text DEFAULT NULL COMMENT 'Detailed technical description',  -- Technical details
  `trigger_reason` varchar(255) DEFAULT NULL COMMENT 'What caused the alert',  -- Reason for alert
  `device_response` varchar(255) DEFAULT NULL COMMENT 'Automated device action taken',  -- Device response
  `status` enum('active','acknowledged','resolved','dismissed') NOT NULL DEFAULT 'active',  -- Alert status
  `acknowledged_by` int(11) DEFAULT NULL COMMENT 'User who acknowledged the alert',  -- User who acknowledged
  `acknowledged_at` datetime DEFAULT NULL,                 -- When alert was acknowledged
  `resolved_at` datetime DEFAULT NULL,                      -- When alert was resolved
  `resolution_notes` text DEFAULT NULL COMMENT 'Notes about how alert was resolved',  -- Resolution details
  `alert_timestamp` datetime NOT NULL COMMENT 'When the alert occurred',  -- When alert occurred
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),  -- Record creation timestamp
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp()  -- Last update timestamp
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='System alerts and notifications';

